/*--------------------------------------
ブロックを可視化
--------------------------------------*/
.block-library-spacer__resize-container {
    background: #333;
    position: relative;
}

.block-library-spacer__resize-container:after {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%,-50%);
    content: "スペーサー";
    color: #ccc;
}

.block-library-spacer__resize-container.is-selected {
    background: #555;
}

p[aria-label^="空のブロック"] {
    background: #555;
    color: #fff;
}
